import React from 'react';
import './col1.css';

const col1 = () => {
    return ( 
        <div className={'col1'}>
            <div className={'Pic1'} />
            <p className="box1">"Over the span of the satellite record, Arctic sea ice has been declining significantly, while sea ice in the Antarctichas increased very slightly"</p>
            <div className={'Pic2'} />
        </div>
     );
}

export default col1;
